import './styles.css';
import Download from './components/Download';
import { Camera } from 'react-feather';

export default function App() {
  return (
    <div
      className='App'
      style={{
        justifyContent: 'center',
        display: 'flex',
        border: '1px solid',
        height: '250px',
        width: '100%',
        width: '300px',
        alignItems: 'center',
        alignContent: 'center'
      }}
    >
      <Camera color='red' size={48} />
      <Download />
    </div>
  );
}
